import React, { useState } from "react";

// Contact Component
const Contact = () => {
  // State management for form fields and message status
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [message, setMessage] = useState("");
  const [status, setStatus] = useState(null); // Success/Error message

  const handleSubmit = async (e) => {
    e.preventDefault();

    const formData = { name, email, message };

    try {
      const response = await fetch("http://localhost:5000/send-email", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });

      const data = await response.json(); // Optional: Use data if needed
      if (response.status === 200) {
        setStatus("Your message was sent successfully!");
      } else {
        setStatus("There was an error sending your message. Please try again.");
      }
    } catch (error) {
      setStatus("An error occurred. Please try again later.");
    }
  };

  return (
    <section id="contact" className="bg-black text-white py-16 px-8">
      <h2 className="text-4xl font-bold text-center mb-8">Contact Me</h2>
      <div className="flex flex-col md:flex-row gap-8">
        {/* Contact Form */}
        <div className="md:w-1/2">
          <h3 className="text-2xl font-semibold mb-4">Get in Touch</h3>
          <form className="space-y-4" onSubmit={handleSubmit}>
            <div>
              <label htmlFor="name" className="block text-sm font-medium">
                Name
              </label>
              <input
                type="text"
                id="name"
                name="name"
                className="w-full p-3 mt-1 rounded-md border border-gray-300 focus:outline-none focus:ring-2 focus:ring-purple-600 text-black"
                value={name}
                onChange={(e) => setName(e.target.value)}
                required
              />
            </div>
            <div>
              <label htmlFor="email" className="block text-sm font-medium">
                Email
              </label>
              <input
                type="email"
                id="email"
                name="email"
                className="w-full p-3 mt-1 rounded-md border border-gray-300 focus:outline-none focus:ring-2 focus:ring-purple-600 text-black"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
              />
            </div>
            <div>
              <label htmlFor="message" className="block text-sm font-medium">
                Message
              </label>
              <textarea
                id="message"
                name="message"
                rows="4"
                className="w-full p-3 mt-1 rounded-md border border-gray-300 focus:outline-none focus:ring-2 focus:ring-purple-600 text-black"
                value={message}
                onChange={(e) => setMessage(e.target.value)}
                required
              ></textarea>
            </div>
            <button
              type="submit"
              className="w-full bg-purple-600 text-white py-3 mt-4 rounded-md hover:bg-purple-700 focus:outline-none focus:ring-2 focus:ring-purple-600"
            >
              Send Message
            </button>
          </form>
          {/* Display status message */}
          {status && (
            <p
              className={`mt-4 text-sm ${
                status.includes("success") ? "text-green-500" : "text-red-500"
              }`}
            >
              {status}
            </p>
          )}
        </div>

        {/* Blog Section */}
        <div className="md:w-1/2">
          <h3 className="text-2xl font-semibold mb-4 text-white">My Blog</h3>
          <div className="space-y-4">
            <div className="bg-white p-6 rounded-md shadow-md hover:shadow-lg transition-all duration-300">
              <h4 className="text-xl font-semibold text-black">How I Built My Portfolio</h4>
              <p className="text-gray-500 text-sm">November 22, 2024</p>
              <p className="mt-2 text-black">
                Building my portfolio has been a rewarding journey that reflects my growth as a web developer...
                <span className="text-purple-600">Read more</span>
              </p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
